import React from 'react';
import style from '../style.module.css';
import ImageGalleryItem from './ImageGalleryItem';

export default function ImageGallery({ pics }) {
  return (
    <ul className={style.ImageGallery}>
      {pics.map((pic) => (
        <ImageGalleryItem
          key={pic.id}
          id={pic.id}
          src={pic.webformatURL}
          alt={pic.tags}
        />
      ))}
    </ul>
  );
}
